import React from "react";

const AssetUpdater = () => {
  return (
    <>
      <div className="assetUpdater">
        <h2>Edit assets</h2>
        <button className="btn btn-primary">Add</button>
        <button className="btn btn-primary">Edit</button>
        <h3>Yo</h3>
      </div>
    </>
  );
};

export default AssetUpdater;
